ConstValues.value:
"    kernel vec4 gray(__sample source, __sample mask) {
        float maskValue = mask.r;
        float gray = dot(source.rgb, vec3(0.299, 0.587, 0.114));
        if(maskValue == 0.0){
           return vec4(vec3(gray),1.0);
        }
        return vec4(mix(vec3(gray),source.rgb,maskValue),1.0);
    }"
